package main

import (
	"fmt"
	"strconv"
)

func operate(input string) (int64, error) {
	size := int64(0)
	for i := 0; i < len(input); {
		if input[i] == '(' {
			var readLenBoundary, repeatCountBoundary int
			for j := i; j < len(input); j++ {
				if input[j] == 'x' {
					readLenBoundary = j
					break
				}
			}
			readLen, err := strconv.Atoi(input[i+1 : readLenBoundary])
			if err != nil {
				return -1, fmt.Errorf("Illegal readLen %s", input[i+1:readLenBoundary])
			}
			for j := readLenBoundary; j < len(input); j++ {
				if input[j] == ')' {
					repeatCountBoundary = j
					break
				}
			}
			repeatCount, err := strconv.Atoi(input[readLenBoundary+1 : repeatCountBoundary])
			if err != nil {
				return -1, fmt.Errorf("Illegal repeatCount %s", input[readLenBoundary+1:repeatCountBoundary])
			}
			inc, err := operate(input[repeatCountBoundary+1 : repeatCountBoundary+1+readLen])
			i = repeatCountBoundary + 1 + readLen
			if err != nil {
				return -1, err
			}
			size += inc * int64(repeatCount)
		} else {
			size++
			i++
		}
	}
	return size, nil
}

